import React from "react";
import Description from "./Description";
import View from "./View";
import logo from "../../images/logo.png";
import {
  FacebookFilled,
  TwitterCircleFilled,
  YoutubeFilled,
  LinkedinFilled,
  InstagramFilled,
} from "@ant-design/icons";
import "./Media.css";

const Hero = () => {
  return (
    <div className="hero">
      <Description />
      <View />
      <div className="hero-logo-bottom">
        <img className="hero-logo-img" src={logo} />
        <div className="social-icons">
          <ul className="hero-social-icons">
            <li>
              <FacebookFilled className="hero-social-icon" />
            </li>
            <li>
              <TwitterCircleFilled className="hero-social-icon" />
            </li>
            <li>
              <YoutubeFilled className="hero-social-icon" />
            </li>
            <li>
              <LinkedinFilled className="hero-social-icon" />
            </li>
            <li>
              <InstagramFilled className="hero-social-icon" />
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Hero;
